import React, { useState, useEffect } from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import { Button } from '@material-ui/core';
import { Link } from 'react-router-dom';
import { line } from 'cli-spinners';
import Axios from "axios";


const useStyles = makeStyles((theme) => ({
    fame: {
        width: "755px",
        height: "653px",
        backgroundColor: "red"
    },
    titleframe: {
        height: "85.7px",
        width: "100%",
        backgroundColor: "blue",
        position: "relative"
    },
    mainframe: {
        height: "567.3px",
        width: "100%",
        backgroundColor: "green"
    },
    textbuilding: {
        fontSize: "22.6px",
        fontWeight: "bold",
        color: "#4A4A4A",
        paddingLeft: 40,
        paddingTop: 22

    },
    line: {
        height: "1px",
        width: "90%",
        backgroundColor: "#D8D8D8",
        top: 30,
        position: "relative",
        margin: "auto"
    },
    eachtitle: {
        fontSize: "18px",
        color: "#4A4A4A"
    },
    setrow: {
        height: "31.5px",
        width: "90%",
        fontSize: "18px",
        color: "#4A4A4A"
    },
    setrow2: {
        height: "31.5px",
        width: "100%",
        fontSize: "18px",
        color: "#4A4A4A"
    },
    setwidth: {
        width: "90%"
    },
    setwidth2:{
        width: "100%",
        backgroundColor: "red"
    },
    setrow3: {
        height: "31.5px",
        width: "200%",
        fontSize: "18px",
        color: "#4A4A4A"
    },
    paper: {
        width: '1163px',
        height: '494px',
        boxShadow: "0px 0px 0px #E8E8E8",
        borderRadius: 5,
        border: "1px solid #AAAAAA",
    },
    fameinfo: {
        width: 670,
        height: 310,
        display: 'absolute',
        float: 'right',
        marginTop: '28px',
        marginRight: '127px'
    },
    famerow: {
        height: "59.86px",
        width: "100%",
        display: "flex",
        position: "relative"

    },
    grab: {
        height: "9.7px",
        width: "100%",
        backgroundColor: "white"
    },
    famerow2: {
        height: "31.55px",
        width: "100%",
        position: 'relative',
        display: "flex"

    },
    input_md: {
        height: "31.551px",
        width: "100%",
        fontSize: "13px",
        color: "#4A4A4A",
    },
    input_sm: {
        width: "156.13px",
        height: "100%",
        fontSize: "13px",
        color: "#4A4A4A",

    },
    input_full: {
        width: "100%",
        height: "31.5px",
        fontSize: "13px",
        color: "#4A4A4A",
        postion: "absolute",
        marginTop: 28.5
    },
    grab4: {
        width: "16.18px"
    },
    block_md: {
        width: "327.645px",
        height: "100%",
    },
    headname: {
        fontSize: "16px",
        color: "#4A4A4A",
        position: "absolute"
    },
    block_sm2: {
        width: "155.429px",
        height: "100%",
    }

}));

export default function Createbuilding(props) {

    const classes = useStyles()
    const { values, setValue, errors, setErrors, handleInputChange, resetFormControls } = props;
    const [inputText, setInputText] = useState("");
    const [items, setItems] = useState([]);



    const [building, setBuilding] = useState("");
    const [address, setAddress] = useState("");
    const [province, setProvince] = useState("");
    const [subdistric, setSubdistric] = useState("");
    const [district, setDistrict] = useState("");
    const [zipcode, setZipcode] = useState("");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");


    const Buildingsave = event => {
        event.preventDefault();
        Axios.post("/building/create-building", {

            "Building": {
                "building_name": building
            },
            "Address": address,
            "District": district,
            "Province": province,
            "SubDistrict": subdistric,
            "Zipcode": zipcode,
            "Email": email,
            "PhoneNumber": phone

        }).then((response) => {
            window.location.href = '/residence';
            console.log(response);
        })

    };

    return (
        <div className={classes.fame}>
            <div className={classes.titleframe}>
                <div className={classes.textbuilding}>
                    Create Building
                </div>
                <div className={classes.line} />
            </div>

            <div className={classes.mainframe}>
            <div className={classes.fameinfo}>
                            <div className={classes.famerow}> {/*   First Name, Last Name */}
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        First Name
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <input className={classes.input_md}>

                                    </input>
                                </div>
                                <div className={classes.grab4} />
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        Last Name
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <input className={classes.input_md}>

                                    </input>
                                </div>
                            </div>
                            <div className={classes.grab} />
                            <div className={classes.famerow}> {/*  Date of Birth, Gender, Identification Number / Passport Number */}

                                <div className={classes.block_sm2}>
                                    <div className={classes.headname}>
                                        Date of Birth
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <input className={classes.input_md}>

                                    </input>
                                </div>
                                <div className={classes.grab4}/>
                                <div className={classes.block_sm2}>
                                    <div className={classes.headname}>
                                        Gender
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <input className={classes.input_md}>

                                    </input>
                                </div>
                                <div className={classes.grab4} />
                                <div className={classes.block_md}>
                                    <div className={classes.headname}>
                                        Identification Number / Passport Number
                                    </div>
                                    <div style={{ height: 4 }}></div>
                                    <input className={classes.input_md}>

                                    </input>
                                </div>
                            </div>
                            <div className={classes.grab} />
                            <div className={classes.famerow} > {/*  Address */}
                                <div className={classes.headname}>
                                    Address
                                </div>
                                <input className={classes.input_full}></input>
                            </div>
                            <div className={classes.grab} />

                            <div className={classes.famerow2}> {/*   District, Sub-district, Province, Zip code */}
                                <input className={classes.input_sm} placeholder="District">

                                </input>
                                <div className={classes.grab4} />
                                <input className={classes.input_sm} placeholder="Sub-district">

                                </input>
